import { getCurrentVideo } from "../actions/Video"


const VideosList =({vedList}) =>{
    const vedLists =vedList.map(ved=>(
<tr key={ved._id}>
<td key={ved.VideoTitle}></td>
<td className="hide-sm">{ved.videosList}</td>
    <td>
        <button className="btn btn-danger"> Delete</button>
    </td>
    </tr>


    ));
return(

<Fragment>
<h2 className="my-2"> Videos</h2>
<table>
<thread>

    <tr>
        <th>Video Title </th>
        
    </tr>
</thread>


</table>

</Fragment>
)


}

VideosList.protoTypes={
videosList:PropTypes.array.isRequired

}
